import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="grey-header">MakaStory</h1>
        <button className="button">Start Adventure</button>
      </header>
    </div>
  );
}

export default App;
